import React from "react";

export default function BoardRender(props) {
  const renderCell = () => {
    switch (props.value) {
      case "X":
        return <X />;
      case "O":
        return <O />;
      default:
        if (props.end || !props.turn) {
          return <div></div>;
        } else {
          switch (props.player) {
            case "X":
              return (
                <div className="placeHolder">
                  <X />
                </div>
              );
            case "O":
              return (
                <div className="placeHolder">
                  <O />
                </div>
              );
            default:
              return <div></div>;
          }
        }
    }
  };
  return (
    <div className="square" onClick={props.onClick.bind(this, props.id)}>
      {renderCell}
    </div>
  );
}
